import style from "./About.module.css"
const About = ()=>{
    
    return (
        <div className={style.container}>
        <h2 className={style.fuente}>Aplicacion creada en el marco de un proyecto integrador</h2>
        <h3 className={style.fuente}>Esta web esta dedicada a poner en practica herramientas y conocimientos,
        vistos en el Modulo 2, de la carrera de Full Stack Development, dictada por Soy Henry</h3>
        <img className={style.imagen} src="https://blog.soyhenry.com/content/images/2021/02/HEADER-BLOG-NEGRO-01.jpg"/>
        </div>
    );
};

export default About;
